  (21,'2015-10-19 07:44:18','2016-11-23 13:28:05',35,12,'<p>Parenting Club memahami bahwa menjadi orangtua memiliki banyak tantangan serta pertanyaan, khususnya untuk orangtua baru. Kini Anda tak perlu khawatir lagi karena Parenting Club akan membantu mengenali kepintaran anak melalui Smart Strength Finder Tool dan memberikan informasi penting yang disesuaikan dengan kepintaran tersebut. Anda juga tidak perlu bingung lagi dalam mencari sekolah untuk si Kecil, gunakan fitur Smart School yang akan memberikan informasi sekolah terbaik untuk mendukung kepintarannya.<br />\n<br />\nSaat Anda memiliki banyak pertanyaan seputar dunia si Kecil, tim ahli kami siap dan dengan senang hati akan menjawabnya di fitur Smart Consultation. Anda pun dapat membaca banyak cerita dan pengalaman orangtua lainnya dalam mendukung si Kecil di fitur Smart Stories atau menonton secara langsung di fitur Live TV. Semua ini terangkum dalam Parenting Club yang hadir untuk mendampingi Anda di setiap langkah menjadi orangtua dalam mendukung kepintaran si Kecil. &nbsp;<br />\n&nbsp;</p>\n\n<p>Parenting Club dipersembahkan oleh Wyeth Nutrition Indonesia. Kunjungi Parenting Club di <a href=\"https://www.facebook.com/Parentingclubid\">Facebook</a>, <a href=\"http://instagram.com/parentingclubid\">Instagram</a>, <a href=\"https://www.youtube.com/progoldparentingclub\">Youtube</a> dan follow di <a href=\"https://twitter.com/parentingclubid\">Twitter</a>.&nbsp;</p>\n','dummy',NULL,'78289121b6366a1','d1777183fcffb02'),
  (22,'2015-10-19 07:51:42','2016-09-15 18:13:17',35,13,'<p>Last Modified:<br />\nThese Terms and Conditions were last modified on August 11, 2009<br />\n&nbsp;<br />\nWyeth has developed and maintains this web site (&quot;Site&quot;) for your personal entertainment, information, education and communication. The Site may, from time to time, contain information relating to various medical conditions and their treatment. Should you have a medical condition, you are advised to promptly see your physician or other medical professional. Through your access to and use of the site, you accept, without limitation or qualification, the terms and conditions (&quot;Terms &amp; Conditions&quot;) set forth.<br />\n<br />\nPlease read these Terms &amp; Conditions carefully before accessing or using the Site. By accessing or using the Site, you acknowledge that you have read, understood and agreed to be bound by the Terms &amp; Conditions set forth below, just as if you had signed them. If you are not willing to be bound by these Terms &amp; Conditions, you may not access the Site.<br />\n<br />\nWyeth may modify these Terms &amp; Conditions at any time, and such modifications shall be deemed effective immediately upon posting on the Site. Any continued use of the Site&nbsp;shall be deemed conclusive of your acceptance of the modified Terms &amp; Conditions.<br />\n<br />\n<strong>1. Use of Site</strong><br />\nYou may freely browse the Site and may freely download material therefrom. Any and all downloaded materials may only be used by you for personal,non-commercial use. You may not distribute, modify, transmit, reuse, repost or use any of such materials for public or commercial purposes, without the express written permission of Wyeth. All copyright and other proprietary notices continued in downloaded materials must be preserved and retained. All contents of the Site are copyrighted work of Wyeth and/or any Wyeth&#39;s suppliers or affiliates unless otherwise noted, and may no