s reasonable efforts to include accurate and up to date information in the Site, however, since information changes so quickly, Wyeth is unable to make any warranties or representations as to its accuracy. Wyeth FURTHER ASSUMES NO LIABILITY OR RESPONSIBILITY AS TO THE RELIABILITY, ACCURACY, VALIDITY, TIMELINESS, USEFULNESS OR COMPLETENESS OF ANY INFORMATION ON THE SITE.<br />\n<br />\n<strong>5. Privacy Policy</strong><br />\nWyeth respects the privacy of its users and has created a Privacy Policy that explains users&#39; rights and responsibilities with respect to personal information disclosed on the Site. To read our Privacy Policy, please click here.<br />\n<br />\n<strong>6. Liability</strong><br />\nYour use of the Site is at your own risk. In no event shall Wyeth or any other party involved in creating, producing or delivering the Site be liable for any damages (including, without limitation, direct, incidental, consequential, indirect or punitive damages, or damages resulting from lost profits, lost data or business interruption) arising out of your access to, use of or inability to access or use, the Site. This includes damages to or viruses that may infect your computer equipment. Wyeth does not guarantee or warrant that files available for download from this Site will be free&nbsp;of infection from viruses, worms, Trojan horses or other code that manifests contaminating or destructive properties. Without limiting the foregoing, everything on the Site is provided to you &lsquo;AS IS&#39; without warranties of any kind, either express or implied, including, but not limited to warranties of merchantability, fitness for a particular purpose or non-infringement. Please note that some jurisdictions may not allow the exclusion of implied warranties, so some of the above exclusions may not apply to you. Check your local laws for any restrictions or limitations regarding the exclusion of implied warranties.<br />\n<br />\n<strong>7. Indemnification</strong><br />\nYou agree to indemnify, defend and hold harmless Wyeth, its officers, directors, employees, agents, suppliers and third party partners from and against all losses, expenses, damages and costs, including reasonable attorneys&#39; fees, resulting from any violation by you of these Terms and Conditions, or any activity related to your account (including negligent or wrongful conduct) by you or any other person accessing the Site using your account.<br />\n<br />\n<strong>8. Confidentiality</strong><br />\nSubject to the terms and conditions set forth in our Privacy Policy, any communication or material that you transmit to, or post on, the Site by electronic mail or otherwise, including but not limited to, any data, questions, comments, suggestions or the like is, and will be treated as, non-confidential and nonproprietary information. Wyeth, or any of its affiliates, may use such communication or material for any purpose whatsoever, including but not limited to, reproduction, disclosure, transmission, publication, broadcast and further posting. Further Wyeth, and its&#39; affiliates, are free to use any ideas, concepts, know-how or techniques contained in any communication or material you send to the Site for any purpose whatsoever including, but not limited to, developing, manufacturing and marketing products.<br />\n<br />\n<strong>9. Trademarks</strong><br />\nThe trademarks, logos and service marks (collectively, the &quot;Trademarks&quot;) displayed on the Site are registered and unregistered trademarks of Wyeth and others. In addition, all page headers, custom graphics, button icons and scripts may be service marks, trademarks and or trade dress of Wyeth and may not be copied, in whole or in part, without the prior written permission of Wyeth. You acknowledge that the Trademarks used and displayed on this site are and shall remain the sole property of Wyeth or the Trademark owner. Nothing contained in this Site should be construed as granting, by implication, estoppel or otherwise, any license or right in and to the Trademarks without the express written permission of Wyeth or the Trademark owner. Your misuse of the Trademarks on the Site and in its contents, except as provided in these Terms and Conditions, is strictly prohibited. You are advised that Wyeth will aggressively enforce its intellectual property rights in the Site and its contents to the fullest extent of the law, including by seeking criminal sanctions.<br />\n<br />\n<strong>10. Copyrights</strong><br />\nWyeth grants you the privilege of accessing and viewing the text, graphics, audio, design, images, charts and other content (The &quot;Wyeth Content&quot;) on the Site solely for your personal, non-commercial use. Wyeth may revoke such privilege at any time with or without notice of any reason or no reason. Any and all Wyeth Content, software and other works on the Site and any reproductions of any of the foregoing (collectively, &quot;Works&quot;) are the copyrighted works of Wyeth and/or its suppliers, and are protected under U.S. and worldwide copyright laws and treaty provisions. Other than the limited grant of access to and viewing of the Wyeth Content set forth above, Wyeth grants you no other privileges or rights in any of the Works. You acknowledge that any other use of the Works, including without limitation, reproduction, modification, distribution, transmission, republication, display, or performance, without the prior written permission of Wyeth, is strictly prohibited.<br />\n<br />\n<strong>Copyright Infringement Notification</strong><br />\nWyeth respects the intellectual property of others, and we ask that you and all of our Site users do the same. If you believe that your copyrighted work has been copied and is accessible on the Site in a way that constitutes copyright infringement, you may notify us pursuant to the Digital Millennium Copyright Act (&quot;DMCA&quot;) by providing Wyeth&#39;s designated agent with all of the following information.<br />\n<br />\n1. The electronic or physical signature of the copyright owner, or the person or entity authorized to act on behalf of the copyright owner.<br />\n2. A specific description of the copyrighted work claimed to be infringed. If multiple copyrighted works exist on a single online site, you may provide a representative list of such works at that site.<br />\n3. A specific description of where the copyrighted work claimed to be infringed exists (including the specific web page address on this site).<br />\n4. A specific description where the original or an authorized copy of the copyrighted work exists (including, for example, a specific Web page address not on this site)<br />\n5. Your name, address, telephone number and, if available, your E-mail address.<br />\n6. A written statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, the person or entity authorized to act on behalf of the copyright owner, or the law.<br />\n7. A written statement by you, made under penalty of perjury, that all of the above information is accurate, and that you are the copyright owner or the person or entity authorized to act on behalf of the copyright owner.<br />\n8. Wyeth&#39;s designated agent for notices of claims of copyright infringement on this site may be reached as follows: Bret I. Parker, Wyeth, 5 Giralda Farms, Madison, NJ 07940, (973) 660-5000, copyright@wyeth.com.<br />\n<br />\nYou should be aware that under the DMCA claimants who make misrepresentations concerning copyright infringement may be liable for damages incurred as a result of the removal or blocking of the of the alleged infringing material, court costs, and attorney&#39;s fees.<br />\n<br />\n<strong>11. Online Communications</strong><br />\nAlthough Wyeth may, from time to time, monitor or review the discussions, chats, postings, transmissions, bulletin boards and the like on the Site, Wyeth is under no obligation to do so and assumes no responsibility or liability arising from the content of the Site nor for any error, defamation, libel, slander, omission, falsehood, obscenity, pornography, profanity, danger or inaccuracy contained in any information within the Site. Wyeth assumes no responsibility for checking information posted in discussions, chats, transmissions, bulletin boards or the like on the Site for accuracy.<br />\n<br />\n<strong>12. Operating Policy</strong><br />\nYou are prohibited from posting or transmitting any unlawful, threatening, libelous, defamatory, obscene, inflammatory, pornographic or profane material or any material that could constitute or encourage conduct that would be considered a criminal offense, give rise to civil liability or would otherwise violate the law. Wyeth will fully cooperate with any law enforcement authorities or court order requesting or directing Wyeth to disclose the identity of anyone posting any such information or materials.<br />\n<br />\n<strong>13. Review of Communications</strong><br />\nWyeth reserves the right, but is not obligated, to review communications and materials posted or uploaded to the Site, and to block or remove communications or materials that it determines to be (a) abusive, defamatory, or obscene, (b) fraudulent, deceptive, or misleading, (c) in violation of a copyright, trademark or other intellectual property right of another, or (d) offensive, objectionable or otherwise unacceptable to Wyeth at its sole discretion.<br />\n<br />\n<strong>14. Editorial Policy</strong><br />\nWyeth reserves the right to alter or delete material from the Site at any time.<br />\n<br />\n<strong>15. No endorsement</strong><br />\nCertain links on the Site lead to resources located on servers that are not maintained by Wyeth or under its control. We provide such links merely for our users&#39; convenience. Wyeth is not responsible for the content of any such referenced Web Sites or for the availability of access to such web sites. Inclusion on the Site of any link to another web site, or any reference to any product or service by trade name, trademark manufacturer, or otherwise, does not constitute or imply an endorsement or recommendation by Wyeth. Access to other sites linked to this Site is at your own risk, and we disclaim all liability with regard to your access to such linked sites.<br />\n<br />\n<strong>16. Void Where Prohibited</strong><br />\nAlthough the information on this Site is accessible worldwide, not all products or services discussed in this Site are available to all persons or in all geographic locations or jurisdictions. Wyeth reserves the right to limit provision of our products or services to any person, geographic region or jurisdiction and/or to limit the quantities of any products or services we provide. Any offer for any product or service made in the materials on this Site is void where prohibited.<br />\n<br />\n<strong>17. Miscellaneous &nbsp;</strong><br />\nThese Terms &amp; Conditions, together with our Privacy Policy and any other agreement that may be entered into by you and Wyeth in connection with a specific product or service of Wyeth, constitute the entire agreement between you and Wyeth and supersede any and all other agreements, representations and understandings, whether written or oral. These Terms &amp; Conditions may not be modified or amended by you without the prior written consent of Wyeth. Wyeth may modify or amend these Terms &amp; Conditions and the Privacy Policy at any time without notice to you. You should regularly review these Terms &amp; Conditions for any modifications or amendments to these Terms &amp; Conditions as your continued use of the Site after a modification or amendment signifies your assent and agreement to these Terms &amp; Conditions, as amended. If any clause or provision set forth in these Terms &amp; Conditions is determined to be illegal, invalid or unenforceable under present or future law, then, you understand and agree 