  (25,'2016-02-26 14:40:01','2016-06-27 12:41:48',35,16,'<p style=\"font-size: 13px; line-height: 20.8px;\"><strong>Ikuti Story Sharing Competition dan menangkan hadiah menarik dari ProGOLD Parenting Club&nbsp;</strong><br />\nHai Mam, yuk berbagi pengalaman seru saat menstimulasi kepintaran Si Kecil dan dapatkan voucher belanja senilai Rp 50.000 untuk 100 orang yang beruntung dan voucher belanja senilai Rp 1.000.000 untuk 10 cerita paling inspiratif! Periode: 24 Juni &ndash; 24 Juli 2016&nbsp;<br />\n<br />\n<strong>Mekanisme:&nbsp;</strong><br />\n1. Jadilah member ProGOLD Parenting Club di&nbsp;<a href=\"http://bit.ly/ProGOLDParentingClub1\">http://bit.ly/ProGOLDParentingClub1&nbsp;</a><br />\n2. Log in ke fitur ProGOLD Moment di&nbsp;<a href=\"http://bit.ly/StorySharingCompetition\">http://bit.ly/StorySharingCompetition</a><br />\n3. Berikan judul cerita di kolom &ldquo;Judul momen&rdquo; dan pilih album &ldquo;Beda Anak Beda Pintar&rdquo;<br />\n4. Unggah foto dan tulis cerita inspiratif tentang bagaimana Mam menstimulasi kepintaran Si Kecil di kolom deskripsi.<br />\n5. Cerita yang diunggah memiliki 30 &ndash; 150 kata.&nbsp;<br />\n6. Jangan lupa sertakan hashtag #BedaAnakBedaPintar<br />\n7. Foto dan cerita yang Mam kirim akan direview terlebih dahulu sebelum dinaikkan ke ProGOLD Moment.<br />\n&nbsp;</p>\n\n<p style=\"font-size: 13px; line-height: 20.8px;\"><strong>Syarat dan Ketentuan:&nbsp;<br />\n1.&nbsp;</strong>Peserta adalah member ProGOLD Parenting Club.<br />\n2. Peserta adalah Mam yang sedang mendukung kepintaran si Kecil yang berusia 1 &ndash; 7 tahun.<br />\n3. Periode kompetisi: 24 Juni &ndash; 24 Juli 2016<br />\n4. Foto dan cerita yang dikirim sebelum dimulainya periode kompetisi, dianggap tidak sah.<br />\n5. Foto harus orisinil, tidak diperkenankan menggunakan foto yang telah mengikuti kompetisi brand lain atau kompetisi WYETH sebelumnya.&nbsp;<br />\n6. Foto bebas dari unsur kekerasan, SARA, pornografi dan politik.<br />\n7. Peserta menjamin kualitas foto sebelum diikutsertakan dalam kompetisi (rekomendasi ukuran 500 x 500 px).&nbsp;<br />\n8. Penyelenggara berhak menggunakan foto yang diikutsertakan dalam kompetisi untuk keperluan promosi website dan media sosial WYETH tanpa harus memohon izin kepada peserta terlebih dahulu.<br />\n9.&nbsp;Pemenang akan diumumkan via website dan media sosial WYETH 29 Juli 2016.<br />\n10. Hadiah berupa:<br />\n&nbsp; &nbsp; - 10 voucher belanja Sodexo senilai Rp 1.000.000 untuk 10 cerita paling inspiratif<br />\n&nbsp; &nbsp; - 100 voucher belanja Sodexo senilai Rp 50.000 untuk 100 peserta yang beruntung.<br />\n11.&nbsp;Hadiah tidak dapat ditukarkan dengan bentuk apapun.<br />\n12. Keputusan juri bersifat mutlak dan tidak dapat diganggu gugat.<br />\n13. Pemenang wajib memberikan klarifikasi dengan mengirimkan identitas/KTP berlaku paling lambat 2 minggu setelah pengumuman.&nbsp;<br />\n14. Hadiah akan dikirimkan ke alamat pemenang yang telah diverifikasi oleh tim penyelenggara.<br />\n15. Dengan mengikuti kompetisi ini, perserta dianggap sudah menyetujui Syarat dan Ketentuan yang berlaku.&nbsp;<br />\n16. Program ini tidak dipungut biaya apapun. Hati-hati terhadap penipuan.<br />\n17. Untuk keterangan lebih lanjut, silahkan hubungi Wyeth Careline di nomor 0800-1821-526 (bebas pulsa).</p>\n','dummy',NULL,NULL,NULL),
  (26,'2016-02-26 14:40:12','2016-03-01 17:45:07',35,17,'<p style=\"text-align: center;\"><strong>SYARAT DAN KETENTUAN PROGRAM SAMPEL GRATIS S-26 PROCAL GOLD<br />\nRASA MADU 350 gram<br />\n(&ldquo;Program&rdquo;)</strong></p>\n&nbsp;\n\n<p>Program ini diselenggarakan oleh PT. WYETH NUTRITION SDUAENAM, berkantor di Perkantoran Hijau Arkadia, Wisma Nestl&eacute; Lantai 5, Jl. Letjen. TB. Simatupang Kav. 88, Jakarta Selatan 12520 (untuk selanjutnya disebut sebagai &ldquo;Penyelenggara&rdquo;).<br />\n<br />\nSeluruh peserta yang terlibat dan berpartisipasi aktif dalam Program ini, dengan ini dianggap telah membaca dan memahami dengan baik, serta setuju tanpa syarat untuk patuh dan taat pada syarat dan ketentuan Program sebagaimana tercantum di bawah ini termasuk seluruh perubahannya jika ada (&ldquo;Ketentuan&rdquo;). Keputusan Penyelenggara mengenai semua hal &ndash; hal yang terkait dengan Program ini bersifat final.<br />\n<br />\n<strong>A. SYARAT AWAL</strong><br />\n<br />\nPeserta adalah:<br />\n1. Warga Negara Indonesia dan bertempat tinggal di Indonesia.<br />\n2. Merupakan konsumen akhir.<br />\n3. <strong>Ibu atau Ayah dari anak berusia 1 (satu) sampai dengan 3 (tiga) tahun.</strong><br />\n4. Berusia minimal 18 tahun (harus dapat dibuktikan dengan Kartu Tanda Penduduk atau Paspor atau kartu identitas lain yang masih berlaku (&ldquo;<strong>Identitas Diri</strong>&rdquo;)). Untuk Peserta atau Peserta terpilih yang pada saat pengumuman masih berusia di bawah 18 tahun, Peserta harus mendapatkan izin tertulis dari orang tua atau wali yang sah untuk ikut serta dalam Program ini, termasuk melakukan seluruh rangkaian acara Program ini.<br />\n<br />\n<strong>B. MEKANISME PROGRAM</strong><br />\n<br />\n1. Periode Program: 1 Maret &ndash; 31 Mei 2016 dan selama persediaan masih ada.<br />\n2. Peserta wajib mendaftar sebagai anggota pada ProGOLD Parenting Club dengan mengisi e-formulir yang terdapat di website <a href=\"http://www.progoldparentingclub.co.id\">www.progoldparentingclub.co.id</a> secara lengkap dan benar, untuk mendapatkan sampel gratis berupa produk S-26 Procal GOLD Rasa Madu 350 gram (&ldquo;<strong>Sampel</strong>&rdquo;).<br />\n3. Peserta hanya berkesempatan mendapatkan Sampel sebanyak 1 (satu) kali.<br />\n4. Penyelenggara akan melakukan verifikasi melalui telepon terhadap data yang dikirimkan melalui e-formulir dalam waktu 2 (dua) minggu setelah tanggal pengiriman e-formulir tersebut.&nbsp;<br />\n5. Penyelenggara memiliki kewenangan sepenuhnya dalam menentukan Peserta yang terpilih untuk mendapatkan sampel gratis pada Program ini. Keputusan Penyelenggara adalah mutlak dan tidak dapat di ganggu gugat.<br />\n6. Penyelenggara akan memberikan notifikasi kepada Peserta yang telah berhasil di verifikasi melalui telepon.<br />\n7. Sampel gratis akan dikirimkan kepada Peserta pada alamat yang tercantum dalam e-formulir dalam waktu 2 (dua) minggu setelah adanya notifikasi dari Penyelenggara.&nbsp;<br />\n8. Penyelenggara akan menanggung biaya yang dikeluarkan untuk pengiriman Sampel.&nbsp;<br />\n9. Sampel tidak dapat dikembalikan dan/atau ditukarkan dengan uang.<br />\n<br />\n<strong>C. DATA PRIBADI</strong><br />\n<br />\nDengan menyetujui Ketentuan ini, maka setiap Peserta bersedia dan memberikan izin untuk dihubungi oleh Penyelenggara melalui direct message, email, telepon atau sms. Dengan berpartisipasi dalam Program ini, setiap Peserta dianggap sudah memberikan persetujuan dan kewenangan kepada Penyelenggara untuk mengungkapkan data pribadi setiap Peserta untuk kepentingan Penyelenggara. Selain itu, Penyelenggara juga berhak untuk menggunakan, mempublikasikan atau menampilkan data pribadi dari setiap Peserta dan setiap Pemenang untuk keperluan iklan dan publikasi, jika dianggap perlu oleh Penyelenggara.<br />\n<br />\n<strong>D. KEPATUHAN PADA KODE ETIK WHO</strong><br />\n<br />\nPeserta setuju untuk mematuhi dan memenuhi seluruh ketentuan dan hukum yang berlaku di Indonesia, khususnya peraturan mengenai peraturan internasional tentang Pemasaran Pengganti Air Susu Ibu yang dikeluarkan oleh World Health Organization (WHO Code).<br />\n<br />\n<strong>E. LAIN-LAIN</strong><br />\n<br />\n1. Peserta Terpilih wajib menggunakan Sampel sesuai dengan ketentuan yang tertera pada kemasan. Penggunaan Sampel yang tidak sesuai dengan ketentuan yang tertera pada kemasan bukan merupakan tanggung jawab Penyelenggara.<br />\n2. Penyelenggara tidak bertanggung jawab<br />\n3. Program ini tidak berlaku untuk karyawan dan/atau keluarga dari karyawan Penyelenggara, dan seluruh pihak yang terkait dengan penyelenggaraan Program ini.<br />\n4. Penyelenggara, menurut pertimbangannya sendiri, berhak untuk mendiskualifikasikan Peserta yang tidak memenuhi dan/atau melanggar dan/atau dicurigai melakukan kecurangan terhadap Ketentuan ini.&nbsp;<br />\n5. Penyelenggara memiliki hak untuk mengubah Ketentuan, jika dianggap perlu, tanpa perlu ada pemberitahuan terlebih dahulu.<br />\n6. Jika ada salah satu pernyataan dan/atau pelaksanaan dari Ketentuan ditemukan batal, melanggar hukum atau tidak dapat dilaksanakan maka poin tersebut tidak mempengaruhi Ketentuan lain untuk tetap berlaku.<br />\n7. Program ini tidak dipungut biaya apapun. Pajak ditanggung pihak Penyelenggara. Hati-hati terhadap penipuan.<br />\n8. Untuk keterangan lebih lanjut, silahkan hubungi Wyeth Careline di nomor 0800-1821-526 (bebas pulsa).</p>\n','dummy',NULL,NULL,NULL),
