tap berlaku.</li>\n\t<li>Program ini tidak dipungut biaya apapun. Pajak ditanggung pihak Penyelenggara. Hati-hati terhadap penipuan.</li>\n\t<li>Untuk keterangan lebih lanjut, silahkan hubungi Wyeth Careline di nomor 0800-1821-526 (bebas pulsa)</li>\n</ol>\n','dummy',NULL,'dummy','dummy'),
  (30,'2016-09-28 11:00:56','2016-10-01 13:33:08',122,20,'<p><span style=\"font-size:22px;\"><strong>SYARAT DAN KETENTUAN FITUR SMART CONSULTATION</strong></span><br />\n<br />\nPunya pertanyaan seputar dunia si Kecil? Silakan bertanya dengan para ahlinya di Smart Consultation. Fitur Parenting Club ini merupakan tempat untuk berkonsultasi mengenai proses pertumbuhan, perkembangan dan cara mendukung kepintaran si Kecil. Fitur ini diselenggarakan oleh PT. WYETH NUTRITION SDUAENAM, berkantor di Perkantoran Hijau Arkadia, Wisma Nestl&eacute; Lantai 5, Jl. Letjen. TB. Simatupang Kav. 88, Jakarta Selatan 12520 (untuk selanjutnya disebut sebagai &ldquo;Penyelenggara&rdquo;).&nbsp;<br />\n<br />\nSeluruh peserta yang terlibat dan berpartisipasi aktif dalam Fitur ini, dengan ini dianggap telah membaca dan memahami dengan baik, serta setuju tanpa syarat untuk patuh dan taat pada syarat dan ketentuan Fitur sebagaimana tercantum di bawah ini termasuk seluruh perubahannya jika ada (&ldquo;Ketentuan&rdquo;). Keputusan Penyelenggara mengenai semua hal &ndash; hal yang terkait dengan Fitur ini bersifat final.<br />\n<br />\n<strong>A. SYARAT AWAL</strong><br />\n<br />\nPeserta adalah:<br />\n1. Warga Negara Indonesia dan bertempat tinggal di Indonesia.<br />\n2. Ibu atau Ayah dari anak berusia minimal 1 (satu) tahun.<br />\n3. Berusia minimal 18 tahun (harus dapat dibuktikan dengan Kartu Tanda Penduduk atau Paspor atau kartu identitas lain yang masih berlaku (&ldquo;Identitas Diri&rdquo;)). Untuk Peserta atau Peserta terpilih yang pada saat pengumuman masih berusia di bawah 18 tahun, Peserta harus mendapatkan izin tertulis dari orang tua atau wali yang sah untuk ikut serta dalam Program ini, termasuk melakukan seluruh rangkaian acara Program ini.<br />\n<br />\n<strong>B. MEKANISME PROGRAM</strong><br />\n<br />\n1. Peserta wajib mendaftar sebagai anggota Parenting Club. &nbsp;&nbsp;<br />\n2. Penyelenggara akan melakukan proses moderasi terhadap seluruh pertanyaan yang diberikan oleh peserta.&nbsp;<br />\n3. Penyelenggara berhak untuk tidak menjawab pertanyaan yang tidak relevan dan/atau pertanyaan yang bersifat medis untuk menghindari kesalahan diagnosa. Peserta dianjurkan untuk berkonsultasi langsung dengan dokter.<br />\n4. Pertanyaan yang dikirim selambat-lambatnya pada hari Senin jam 12 siang akan dijawab oleh tim ahli pada hari Jumat setiap minggunya.&nbsp;<br />\n5. Jika pertanyaan peserta dijawab, Penyelenggara akan mengirimkan notifikasi ke email peserta.<br />\n<br />\n<strong>C. KEPATUHAN PADA KODE ETIK WHO</strong><br />\n<br />\nPeserta setuju untuk mematuhi dan memenuhi seluruh ketentuan dan hukum yang berlaku di Indonesia, khususnya peraturan mengenai peraturan internasional tentang Pemasaran Pengganti Air Susu Ibu yang dikeluarkan oleh World Health Organization (WHO Code).<br />\n<br />\n<br />\n<strong>D. LAIN-LAIN</strong><br />\n<br />\n1. Penyelenggara memiliki hak untuk mengubah Ketentuan, jika dianggap perlu, tanpa perlu ada pemberitahuan terlebih dahulu.<br />\n2. Jika ada salah satu pernyataan dan/atau pelaksanaan dari Ketentuan ditemukan batal, melanggar hukum atau tidak dapat dilaksanakan maka poin tersebut tidak mempengaruhi Ketentuan lain untuk tetap berlaku.<br />\n3. Fitur ini tidak dipungut biaya apapun. Hati-hati terhadap penipuan.<br />\n4. Untuk keterangan lebih lanjut, silahkan hubungi Wyeth Careline di nomor 0800-1821-526 (bebas pulsa)<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n&nbsp;</p>\n','dummy',NULL,'dummy','dummy'),
  (31,'2016-11-04 06:52:52','2017-05-10 08:27:22',242,21,'<p align=\"center\"><strong>SYARAT DAN KETENTUAN </strong><strong> </strong><br />\n<strong>PROGRAM KOMPETISI #PINTARNYABERSINAR</strong></p>\n\n<p>&nbsp;</p>\n\n<p>Stimulasi yang tepat akan membuat kepintaran si Kecil semakin bersinar. Gunakan Smart Strength Finder Tool untuk mengenali kepintaran si Kecil, asah kepintarannya dengan melakukan aktivitas stimulasi yang terangkum dalam 21 Days Smart Stimulation dan dapatkan beragam hadiah menarik untuk peserta yang paling kreatif.<br />\n&nbsp;</p>\n\n<p>Program ini diselenggarakan oleh PT. WYETH NUTRITION SDUAENAM, berkantor di Perkantoran Hijau Arkadia, Wisma Nestl&eacute; Lantai 5, Jl. Letjen. TB. Simatupang Kav. 88, Jakarta Selatan 12520 (untuk selanjutnya disebut sebagai &ldquo;Penyelenggara&rdquo;). &nbsp;<br />\n&nbsp;</p>\n\n<p>Seluruh peserta yang terlibat dan berpartisipasi aktif dalam Program ini, dengan ini dianggap telah membaca dan memahami dengan baik, serta setuju tanpa syarat untuk patuh dan taat pada syarat dan ketentuan Program sebagaimana tercantum di bawah ini termasuk seluruh perubahannya jika ada (&ldquo;Ketentuan&rdquo;). Keputusan Penyelenggara mengenai semua hal &ndash; hal yang terkait dengan Program ini bersifat final.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>A. SYARAT AWAL</strong></p>\n\n<p>&nbsp; &nbsp; &nbsp; Peserta adalah:</p>\n\n<ol>\n\t<li>Warga Negara Indonesia dan bertempat tinggal di Indonesia.</li>\n\t<li>Ibu atau Ayah dari anak berusia minimal 1 (satu) tahun.</li>\n\t<li>Berusia minimal 18 tahun (harus dapat dibuktikan dengan Kartu Tanda Penduduk atau Paspor atau kartu identitas lain yang masih berlaku (&ldquo;Identitas Diri&rdquo;)). Untuk Peserta atau Peserta terpilih yang pada saat pengumuman masih berusia di bawah 18 tahun, Peserta harus mendapatkan izin tertulis dari orang tua atau wali yang sah untuk ikut serta dalam Program ini, termasuk melakukan seluruh rangkaian acara Program ini.</li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><strong>B. MEKANISME PROGRAM</strong></p>\n\n<ol>\n\t<li>Peserta wajib mendaftar sebagai anggota Parenting Club.&nbsp;&nbsp;</li>\n\t<li>Peserta wajib menjawab semua pertanyaan yang ada dan menyelesaikan tes Smart Strength Finder Tool.</li>\n\t<li>Peserta wajib mengunduh panduan 21 Days Smart Stimulation berdasarkan kepintaran yang dimiliki oleh anak peserta atau hasil dari Smart Strength Finder Tool.</li>\n\t<li>Kompetisi ini berlangsung selama 21 hari (Periode: 9-29 November 2016) dimana peserta diminta untuk melakukan&nbsp;stimulasi yang terdapat dalam 21 Days Smart Stimulation.&nbsp;</li>\n\t<li>Peserta wajib follow akun Instagram <a href=\"https://www.instagram.com/parentingclubid/\">@parentingclubid</a>.</li>\n\t<li>Peserta wajib mengunggah empat foto saat anak melakukan 21 Days Smart Stimulation dengan menggunakan hashtag #PintarnyaBersinar sesuai dengan tema berikut;\n\t<p style=\"margin-left: 40px;\">-&nbsp; <strong>Parents Support</strong>, melakukan aktivitas tersebut bersama dengan orangtua<br />\n\t-&nbsp; <strong>Smart Playdate</strong>, melakukan aktivitas tersebut bersama dengan teman sebaya<br />\n\t-&nbsp; <strong>Learning at Home</strong>, melakukan aktivitas tersebut di dalam rumah<br />\n\t-&nbsp; <strong>Nature&rsquo;s bestfriend</strong>, melakukan aktivitas tersebut di luar ruangan.</p>\n\t</li>\n\t<li>Peserta boleh mengunggah empat foto selama empat hari berturut-turut atau pun tidak.</li>\n\t<li>Peserta <strong>tidak diperbolehkan</strong> mengunggah empat foto atau beberapa foto dalam satu hari.</li>\n\t<li>Peserta harus mengunggah empat foto dengan tema tersebut. Jika kurang, maka peserta dianggap tidak memenuhi kualifikasi.</li>\n\t<li>Penyelenggara akan melakukan proses moderasi terhadap foto yang dikirimkan oleh peserta.</li>\n\t<li>Penyelenggara akan melakukan verifikasi melalui telepon terlebih dahulu terhadap peserta yang terpilih.</li>\n\t<li>Penyelenggara memiliki kewenangan sepenuhnya dalam menentukan Peserta yang terpilih untuk mendapatkan hadiah dalam Program ini. Keputusan Penyelenggara adalah mutlak dan tidak dapat diganggu gugat.</li>\n\t<li>Penyelenggara akan memberikan notifikasi kepada Peserta yang telah berhasil di verifikasi melalui telepon.</li>\n\t<li>Hadiah akan dikirimkan kepada Peserta pada alamat yang tercantum di akun Parenting Club dalam waktu kurang lebih 2 (dua) minggu setelah adanya notifikasi dari Penyelenggara.</li>\n\t<li>Penyelenggara akan menanggung biaya yang dikeluarkan untuk pengiriman hadiah. &nbsp;&nbsp;</li>\n\t<li>Hadiah tidak dapat dikembalikan, digabungkan dengan hadiah lainnya dan/atau ditukarkan dengan uang.</li>\n\t<li>Hadiah berupa:\n\t<ol type=\"a\">\n\t\t<li>Grand Prize untuk pemenang utama: iPhone 7 Plus, 200 Point Rewards, dan Merchandise menarik</li>\n\t\t<li>Runner Up Prize untuk tiga pemenang: Voucher belanja senilai IDR 1.000.000 dan Merchandise menarik</li>\n\t\t<li>Hadiah hiburan untuk 50 pemenang: Voucher belanja senilai IDR 100.000 dan Merchandise menarik</li>\n\t</ol>\n\t</li>\n</ol>\n\n<p><br />\n<strong>C. DATA PRIBADI</strong></p>\n\n<p>Dengan menyetujui Ketentuan ini, maka setiap Peserta bersedia dan memberikan izin untuk dihubungi oleh Penyelenggara melalui direct message, email, telepon atau sms. Dengan berpartisipasi dalam Program ini, setiap Peserta dianggap sudah memberikan persetujuan dan kewenangan kepada Penyelenggara untuk mengungkapkan data pribadi setiap Peserta untuk kepentingan Penyelenggara. Selain itu, Penyelenggara juga berhak untuk menggunakan, mempublikasikan atau menampilkan data pribadi dari setiap Peserta dan setiap Pemenang untuk keperluan iklan dan publikasi, jika dianggap perlu oleh Penyelenggara.</p>\n\n<p><br />\n<strong>D. KEPATUHAN PADA KODE ETIK WHO</strong></p>\n\n<p>Peserta setuju untuk mematuhi dan memenuhi seluruh ketentuan dan hukum yang berlaku di Indonesia, khususnya peraturan mengenai peraturan internasional tentang Pemasaran Pengganti Air Susu Ibu yang dikeluarkan oleh World Health Organization (WHO Code).</p>\n\n<p><br />\n<strong>E. LAIN-LAIN</strong></p>\n\n<ol>\n\t<li>Peserta Terpilih wajib menggunakan hadiah dengan sebaik-baiknya.</li>\n\t<li>Program ini tidak berlaku untuk karyawan dan/atau keluarga dari karyawan Penyelenggara, dan seluruh pihak yang terkait dengan penyelenggaraan Program ini.</li>\n\t<li>Penyelenggara, menurut pertimbangannya sendiri, berhak untuk mendiskualifikasikan Peserta yang tidak memenuhi dan/atau melanggar dan/atau dicurigai melakukan kecurangan terhadap Ketentuan ini.</li>\n\t<li>Penyelenggara memiliki hak untuk mengubah Ketentuan, jika dianggap perlu, tanpa perlu ada pemberitahuan terlebih dahulu.</li>\n\t<li>Jika ada salah satu pernyataan dan/atau pelaksanaan dari Ketentuan ditemukan batal, melanggar hukum atau tidak dapat dilaksanakan maka poin tersebut tidak mempengaruhi Ketentuan lain untuk tetap berlaku.</li>\n\t<li>Program ini tidak dipungut biaya apapun. Pajak ditanggung pihak Penyelenggara. Hati-hati terhadap penipuan.</li>\n\t<li>Untuk keterangan lebih lanjut, silahkan hubungi Wyeth Careline di nomor 0800-1821-526 (bebas pulsa)</li>\n</ol>\n','dummy',NULL,'dummy','dummy'),
  (32,'2016-11-16 12:36:49','2016-11-16 13:35:54',122,22,'<strong>1. Saya ingin bergabung dengan Parenting Club, tetapi mengapa saya tidak bisa register?</strong><br />\nSaat melakukan registrasi, pastikan Anda mengisi kolom data yang diminta dengan benar sesuai petunjuk. Pada kolom nomor telepon, cukup cantumkan angka, tanpa spasi atau simbol apa pun.&nbsp;<br />\n<br />\nContoh penulisan nomor telepon yang benar: 08111234567<br />\nContoh penulisan nomor telepon yang salah: +62 811 1234 567 atau 081-1123-4567<br />\n<br />\nPastikan juga bahwa email dan nomor telepon yang Anda cantumkan belum pernah digunakan untuk mendaftar di situs Parenting Club sebelumnya. Setelah semua kolom telah terisi, beri tanda centang pada kolom &ldquo;I&rsquo;m not a robot&rdquo; dan kolom yang menyatakan Anda menyetujui Syarat dan Ketentuan Wyeth Nutrition, lalu klik bagian register.<br />\n<br />\n<strong>2. Saya sudah pernah register di Parenting Club, tetapi mengapa saya tidak bisa login?</strong><br />\nSetelah registrasi, Anda perlu melakukan aktivasi akun Anda terlebih dahulu. Caranya, cek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol &ldquo;Konfirmasi Sekarang&rdquo;, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.<br />\n<br />\nApabila akun Anda telah diaktifkan, maka Anda dapat login di Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club. Penulisan password yang benar adalah minimal terdiri dari 8 karakter, dan merupakan gabungan dari huruf, angka, dan simbol.<br />\n<br />\nContoh penulisan password yang benar: mamanayra_1306 atau mamanayra@1306<br />\nContoh penulisan password yang salah: mamanay<br />\n<br />\n<strong>3. Bagaimana cara mengganti password saya di Parenting Club?</strong><br />\nUntuk mengganti password, Anda cukup login, kemudian buka profile page Anda. Klik kolom setting, lalu klik bagian &ldquo;change password&rdquo;. Isi ketiga kolom yang tersedia, lalu klik &ldquo;update setting&rdquo;.<br />\n<br />\n<strong>4. Bagaimana cara mengaktifkan akun saya di Parenting Club?</strong><br />\nCara mengaktifkannya adalah dengan mengecek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol &ldquo;Konfirmasi Sekarang&rdquo;, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.<br />\n<br />\nApabila akun Anda telah diaktifkan, maka Anda dapat login ke Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club.<br />\n<br />\nJika email notifikasi tidak juga masuk ke inbox email ataupun folder spam Anda, kembalilah ke homepage Parenting Club, lalu klik kolom login yang terletak di bagian kanan atas. Setelah muncul window untuk login, klik bagian &ldquo;forgot password&rdquo;, lalu ikuti langkah selanjutnya.<br />\n<br />\n<strong>5. Saya ingin mengenali jenis kepintaran anak saya, tetapi mengapa saya tidak bisa menggunakan fitur Smart Strength Finder?</strong><br />\nFitur Smart Strength Finder otomatis dapat digunakan apabila usia anak yang tercantum di profil Anda di atas 1 tahun.<br />\n<br />\n<strong>6. Saya ingin mencari informasi mengenai sekolah yang tepat untuk mendukung kepintaran anak saya, tetapi mengapa saya tidak bisa menggunakan fitur Smart School?</strong><br />\nFitur Smart School otomatis dapat digunakan apabila usia anak yang tercantum di profil Anda di atas 1 tahun.<br />\n<br />\n<strong>7. Saya telah mengirimkan pertanyaan mengenai perkembangan anak saya kepada tim ahli dari Parenting Club melalui fitur Smart Consultation. Berapa lama saya harus menunggu untuk mendapatkan jawabannya?&nbsp;</strong><br />\nFitur Smart Consultation merupakan tempat bagi Anda untuk berkonsultasi dengan para ahli mengenai proses pertumbuhan, perkembangan dan cara mendukung kepintaran si Kecil. Seluruh peserta yang terlibat dan berpartisipasi aktif dalam Fitur ini dianggap telah membaca dan memahami dengan baik, serta setuju tanpa syarat untuk patuh dan taat pada syarat dan ketentuan Fitur.<br />\n<br />\nUntuk dapat berpartisipasi dalam fitur Smart Consultation, peserta wajib mendaftar sebagai anggota Parenting Club. Pertanyaan yang dikirimkan oleh seluruh peserta akan melalui proses moderasi oleh penyelenggara. Pertanyaan yang tidak relevan/pertanyaan yang bersifat medis tidak akan dijawab untuk menghindari kesalahan diagnosis. Pertanyaan yang dikirim selambat-lambatnya pada hari Senin pukul 12 siang akan dijawab oleh tim ahli pada hari Jumat setiap minggunya. Peserta yang pertanyaannya dijawab oleh tim ahli akan menerima email notifikasi.&nbsp;<br />\n<br />\n<strong>8. Akun saya di Parenting Club tiba-tiba terkunci. Bagaimana cara mengaktifkannya kembali?</strong><br />\nBuka homepage Parenting Club, lalu klik kolom login yang terletak di bagian kanan atas. Setelah muncul window untuk login, klik bagian &ldquo;forgot password&rdquo;. Pada laman selanjutnya, isi kolom email sesuai dengan email yang dicantumkan pada saat registrasi di Parenting Club, lalu klik &ldquo;forgot password&rdquo;.&nbsp;<br />\n<br />\nBuka inbox email Anda, dan klik email dari Parenting Club. Klik &ldquo;ubah password&rdquo;, isi dengan password baru, lalu klik &ldquo;Reset Password&rdquo;.<br />\n<br />\nPerlu diketahui bahwa proses re-aktivasi akun yang terkunci melalui mekanisme forgot pasword hanya dapat dilakukan jika Anda sudah melakukan registrasi dan aktivasi melalui email kemudian salah menuliskan password hingga lima kali sehingga akun Anda otomatis terkunci.&nbsp;<br />\n<br />\nProses re-aktivasi akun yang terkunci tidak bisa dilakukan jika Anda sudah melakukan registrasi tetapi belum pernah melakukan aktivasi melalui email. Bila ini yang terjadi, maka Anda harus melakukan aktivasi akun terlebih dahulu. Lihat caranya pada FAQ no 4.<br />\n<br />\n&nbsp;','dummy',NULL,'dummy','dummy'),
  (33,'2018-01-12 04:18:53',NULL,122,23,'<strong>CARA WYETH NUTRITION MENGGUNAKAN COOKIES DAN TEKNOLOGI PELACAKAN LAINNYA</strong><br />\n<br />\n<strong>Pernyataan Cookies Wyeth Nutrition</strong><br />\n<br />\nTerima kasih telah mengunjungi&nbsp;<a href=\"https://www.parentingclub.co.id/\">www.parentingclub.co.id</a> (&ldquo;Situs Web&rdquo;).&nbsp;Pernyataan Cookie ini berlaku untuk situs Web, setiap halaman situs web atau halaman bermerek pada platform pihak ketiga (misalnya YouTube dan Facebook) dan aplikasi-aplikasi yang diakses atau digunakan melalui situs Wyeth Nutrition atau platform seperti yang dioperasikan oleh atau atas nama <a href=\"https://www.parentingclub.co.id/\">www.parentingclub.co.id</a><br />\nDengan menggunakan <a href=\"https://www.parentingclub.co.id/\">www.parentingclub.co.id</a>, Anda setuju untuk kami menggunakan cookies dan teknologi pelacakan lain sesuai dengan pemberitahuan ini.&nbsp;Jika Anda tidak setuju untuk kami menggunakan cookies dan teknologi pelacakan lain dengan cara ini, Anda harus menetapkan penyesuaian pengaturan browser kami atau tidak menggunakan <a href=\"https://www.parentingclub.co.id/\">www.parentingclub.co.id</a>. Jika Anda menonaktifkan cookie yang kami gunakan, ini dapat mempengaruhi pengalaman penggunaan Anda pada saat ada di <a href=\"https://www.parentingclub.co.id/\">www.parentingclub.co.id.</a><br />\nBila menggunakan perangkat mobile untuk terhubung ke internet, Anda juga harus mengacu pada pernyataan privasi dari Aplikasi tertentu yang Anda gunakan guna memahami praktik pengumpulan data spesifiknya.<br />\n&nbsp;<br />\n<strong>1.&nbsp;Apakah <em>Cookies </em>itu?</strong><br />\n<br />\n<em>Cookies </em>adalah file teks kecil yang ditempatkan pada komputer Anda oleh situs web yang Anda kunjungi.&nbsp;Mereka banyak digunakan untuk membuat situs bekerja, atau bekerja lebih efisien, serta memberikan informasi kepada pemilik situs web.&nbsp;Lihat di bawah untuk informasi rinci tentang apa yang dikumpulkan oleh cookies dan bagaimana kami menggunakan informasi tersebut.<br />\nUntuk informasi lebih lanjut tentang jenis data yang umumnya kami kumpulkan, silakan baca pernyataan privasi kami.<br />\n<br />\n<strong>2.&nbsp;Bagaimana dan mengapa kita menggunakan Cookies?</strong><br />\n<br />\nKami menggunakan cookie untuk meningkatkan penggunaan dan fungsi dari <a href=\"https://www.parentingclub.co.id/\">www.parentingclub.co.id</a> dan untuk mendapatkan pemahaman yang lebih baik tentang bagaimana pengunjung menggunakan <a href=\"www.parentingclub.co.id\">www.parentingclub.co.id</a><a href=\"https://www.parentingclub.co.id/\"> </a>serta alat-alat dan layanan yang ditawarkan pada mereka.&nbsp;Cookies membantu kami menyesuaikan Situs Wyeth Nutrition dengan kebutuhan pribadi Anda, untuk meningkatkan kemudahan penggunaannya, mendapatkan umpan balik kepuasan pelanggan dan untuk berkomunikasi dengan Anda di tempat lain melalui internet.<br />\n&nbsp;<br />\n<strong>3.&nbsp;Apa jenis dari cookies&nbsp;dapat digunakan di Situs Wyeth Nutrition?</strong><br />\n<br />\n&nbsp;Kami dapat menggunakan jenis&nbsp;cookie&nbsp;berikut pada Situs Wyeth Nutrition:<br />\n<br />\n<strong><em>Session cookies</em></strong>&nbsp;- Ini adalah file&nbsp;cookie&nbsp;sementara yang akan terhapus pada saat Anda menutup&nbsp;browser&nbsp;Anda.&nbsp;Ketika Anda menghidupkan kembali&nbsp;browser&nbsp;Anda dan kembali ke situs yang membuat&nbsp;cookie&nbsp;itu, situs web akan memperlakukan Anda sebagai pengunjung baru.<br />\n<br />\n<strong><em>Persistent cookies</em></strong>&nbsp;-&nbsp;Cookies&nbsp;ini tinggal pada&nbsp;browser&nbsp;Anda sampai Anda menghapusnya secara manual atau sampai&nbsp;browser&nbsp;Anda menghapus mereka berdasarkan periode durasi yang sudah diatur dalam&nbsp;cookie.&nbsp;Cookies&nbsp;ini akan mengenali Anda sebagai pengunjung yang kembali.<br />\n<br />\n<strong><em>Necessary cookies</em></strong>&nbsp;-&nbsp;cookies&nbsp;ini secara ketat diperlukan untuk pengoperasian Situs Wyeth Nutrition.&nbsp;Mereka memungkinkan Anda untuk menavigasi sekitar situs dan menggunakan fitur-fitur kami.<br />\n<br />\n<strong><em>Cookies&nbsp;yang mengirimkan informasi kepada kami</em></strong> -&nbsp;ini adalah&nbsp;cookie&nbsp;yang kita tetapkan pada Situs Wyeth Nutrition dan mereka hanya dapat dibaca oleh situs tersebut.&nbsp;Hal ini dikenal sebagai&nbsp;cookie&nbsp;&quot;Pihak Pertama&quot;.<br />\nKami juga menempatkan&nbsp;cookie&nbsp;di iklan Wyeth Nutrition&nbsp;yang ditempatkan pada situs-situs lain yang dimiliki oleh pihak ketiga (misalnya&nbsp;Facebook).&nbsp;Kami memperoleh informasi melalui&nbsp;cookie&nbsp;ketika Anda mengklik atau berinteraksi dengan iklan tersebut.&nbsp;Dalam situasi ini Wyeth Nutrition adalah menempatkan&nbsp;cookie&nbsp;&quot;Pihak Ketiga&quot;. Wyeth Nutrition dapat menggunakan informasi yang diperoleh oleh&nbsp;cookie&nbsp;ini dalam melayani Anda dengan iklan yang relevan dan menarik bagi Anda berdasarkan perilaku&nbsp;online&nbsp;masa lalu Anda.<br />\n<br />\n<strong><em>Cookie&nbsp;yang mengirimkan informasi ke perusahaan lain</em></strong> -&nbsp;Ini adalah&nbsp;cookie&nbsp;yang ditetapkan pada Situs Wyeth Nutrition oleh perusahaan mitra kami (misalnya&nbsp;Facebook&nbsp;atau pengiklan). Mereka dapat menggunakan data yang dikumpulkan dari&nbsp;cookies&nbsp;ini untuk menargetkan iklan secara anonim kepada Anda pada situs-situs lain, berdasarkan kunjungan Anda ke Situs Wyeth Nutrition. Misalnya, jika Anda menggunakan&nbsp;widget&nbsp;sosial (misalnya ikon&nbsp;Facebook) pada Situs Wyeth Nutrition itu akan merekam &quot;share&quot; atau &quot;like&quot;.&nbsp;Facebook&nbsp;(sebagai perusahaan yang mengatur&nbsp;cookie&nbsp;ini) akan mengumpulkan data tersebut.<br />\n&nbsp;<br />\n&nbsp;<strong>4.&nbsp;Contoh cookies yang digunakan pada situs web ini</strong><br />\n&nbsp;\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" width=\"100.0%\">\n\t<thead>\n\t\t<tr>\n\t\t\t<th style=\"width: 30px;\"><strong>Cookie yang digunakan/Jenis dan kategori</strong></th>\n\t\t\t<th><strong>Tujuan</strong></th>\n\t\t\t<th><strong>Data apa&nbsp;</strong><strong>yang&nbsp;</strong><strong>dikoleksi</strong></th>\n\t\t\t<th><strong>Rincian</strong></th>\n\t\t</tr>\n\t</thead>\n\t<tbody>\n\t\t<tr>\n\t\t\t<td><strong>Cookies Kinerja</strong><br />\n\t\t\t&nbsp;<br />\n\t\t\t<u>Jenis</u>:<br />\n\t\t\tAnalitik<br />\n\t\t\t&nbsp;<br />\n\t\t\t<u>Kategori</u>:<br />\n\t\t\t<em>Persistent</em><br />\n\t\t\t<em>Session</em><br />\n\t\t\tPihak Ketiga<br />\n\t\t\t&nbsp;</td>\n\t\t\t<td>&nbsp;Membantu kita memahami bagaimana pengunjung berinteraksi dengan situs web kami dengan memberikan informasi tentang &nbsp;daerah yang dikunjungi, waktu yang dihabiskan dan masalah apapun yang dihadapi, seperti pesan kesalahan. Ini membantu &nbsp;kami meningkatkan kinerja situs web kami.</td>\n\t\t\t<td>&nbsp;Semua data dikoleksi dan disatukan &nbsp;secara anonim.</td>\n\t\t\t<td><a href=\"https://developers.google.com/analytics/devguides/collection/analyticsjs/cookie-usage\" target=\"_blank\">Google Analytics;</a><br />\n\t\t\t&nbsp;<br />\n\t\t\t<a href=\"https://support.google.com/adsense/answer/2839090?hl=en\" target=\"_blank\">DoubleClick;</a></td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td><strong>Cookies </strong><br />\n\t\t\t<strong>Berbagi Sosial</strong><br />\n\t\t\t<strong>(kadangkala </strong><br />\n\t\t\t<strong>disebut cookies </strong><br />\n\t\t\t<strong>&ldquo;Pihak </strong><br />\n\t\t\t<strong>Ketiga&rdquo; atau </strong><br />\n\t\t\t<strong>&ldquo;Widgets </strong><br />\n\t\t\t<strong>Sosial&rdquo;)</strong><br />\n\t\t\t&nbsp;<br />\n\t\t\t<u>Jenis</u>:<br />\n\t\t\tMedia/Berbagi Sosial<br />\n\t\t\t&nbsp;<br />\n\t\t\t<u>Kategori</u>:<br />\n\t\t\tPihak Ketiga<br />\n\t\t\t&nbsp;</td>\n\t\t\t<td>&nbsp;Berbagi sosial yang ditawarkan di situs ini dijalankan oleh pihak ketiga. Pihak ketiga mungkin drop cookies pada komputer &nbsp;Anda ketika Anda menggunakan fitur berbagi sosial di situs web ini, atau jika Anda sudah login ke dalamnya. Cookies ini &nbsp;membantu meningkatkan pengalaman Anda di situs Web ini.<br />\n\t\t\t&nbsp;<br />\n\t\t\t&nbsp;Mereka memungkinkan Anda untuk berbagi komentar/ peringkat/halaman/bookmark dan membantu memberikan akses ke &nbsp;jaringan sosial dan alat-alat online sosial yang lebih mudah.<br />\n\t\t\t&nbsp;</td>\n\t\t\t<td><em>&nbsp;Cookies</em> ini dapat mengumpulkan &nbsp;data pribadi yang telah secara &nbsp;sukarela Anda ungkapkan, seperti &nbsp;nama pengguna Anda.</td>\n\t\t\t<td><a href=\"https://apps.ghostery.com/en/apps/facebook_social_plugins\" target=\"_blank\"><em>Facebook</em><em><u>;</u></em></a><br />\n\t\t\t&nbsp;<br />\n\t\t\t<a href=\"https://apps.ghostery.com/en/apps/twitter_button\" target=\"_blank\"><em>Twitter;</em></a></td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td><strong>Target/Iklan</strong><br />\n\t\t\t&nbsp;<br />\n\t\t\t<u>Jenis</u>:<br />\n\t\t\tPelacak Situs Menyilang<br />\n\t\t\t&nbsp;<br />\n\t\t\t&nbsp;<br />\n\t\t\t&nbsp;<br />\n\t\t\t&nbsp;<br />\n\t\t\t<u>Kategori</u>:<br />\n\t\t\t<em>Persistent</em><br />\n\t\t\t<em>Session</em><br />\n\t\t\tPihak Ketiga</td>\n\t\t\t<td><em>&nbsp;Cookies </em>ini digunakan untuk menyampaikan konten melalui iklan bertarget yang relevan dengan Anda dan minat Anda atau &nbsp;untuk membatasi jumlah berapa kali Anda melihat iklan tertentu.<br />\n\t\t\t&nbsp;<br />\n\t\t\t<em>&nbsp;Cookies </em>ini juga membantu kita mengukur efektivitas kampanye iklan di Situs Web Wyeth Nutrition dan Non-Wyeth Nutrition. &nbsp;Kami dapat berbagi informasi ini dengan pihak lain, termasuk lembaga kami.</td>\n\t\t\t<td><em>&nbsp;Cookies </em>ini melacak pengguna &nbsp;melalui alamat IP mereka.</td>\n\t\t\t<td><a href=\"https://apps.ghostery.com/en/apps/doubleclick\" target=\"_blank\">DoubleClick;&nbsp;</a></td>\n\t\t</tr>\n\t\t<tr>\n\t\t\t<td><strong>Lain-Lain</strong></td>\n\t\t\t<td>&nbsp;<br />\n\t\t\t<em>Flash Cookie</em> ini mungkin menyimpan preferensi Anda seperti kontrol volume atau skor pertandingan tinggi, atau menampilkan konten berdasarkan apa yang Anda lihat di situs Web dalam rangka untuk personalisasi kunjungan Anda. Mitra pihak ketiga kami menyediakan fitur-fitur tertentu di situs seperti promosi, dan permainan dan menggunakan <em>Flash Cookies</em> untuk mengumpulkan dan menyimpan informasi Anda.</td>\n\t\t\t<td>&nbsp;</td>\n\t\t\t<td>&nbsp;</td>\n\t\t</tr>\n\t</tbody>\n</table>\n&nbsp;<br />\n<sup><em>Teknologi serupa lainnya</em></sup><br />\n<br />\nSitus Wyeth Nutrition juga menggunakan teknologi pelacakan lain termasuk alamat IP,&nbsp;log file&nbsp;dan suar-suar web, yang juga membantu kami untuk menyesuaikan Situs Wyeth Nutrition dengan kebutuhan pribadi Anda.<br />\n<br />\n<em>Alamat IP&nbsp;&nbsp;&nbsp;&nbsp;</em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\n<br />\nAlamat IP adalah nomor yang digunakan oleh komputer pada jaringan untuk mengidentifikasi komputer Anda setiap kali Anda masuk ke dalam Internet.&nbsp;Kami dapat merekam Alamat IP untuk tujuan berikut: (i) memecahkan masalah teknis, (ii) menjaga keamanan situs dan keamanan (iii) lebih memahami bagaimana situs kami dimanfaatkan, dan (iv) untuk konten penyesuaian yang lebih baik guna kebutuhan Anda tergantung pada negara dimana Anda berada.<br />\n&nbsp;<br />\n<em>File log</em><br />\n<br />\nKami (atau pihak ketiga atas nama kami) dapat mengumpulkan informasi dalam bentuk&nbsp;log file&nbsp;yaitu tentang aktivitas situs web yang tercatat dan mengumpulkan statistik tentang kebiasaan&nbsp;browsing&nbsp;pengguna.&nbsp;Entri ini dihasilkan secara anonim, dan membantu kami mengumpulkan (antara lain) (i) jenis&nbsp;browser&nbsp;dan sistem operasi pengguna, (ii) informasi tentang sesi pengguna (seperti mereka datang dari URL apa, tanggal dan waktu mereka mengunjungi situs web kami, dan halaman yang mereka telah lihat di situs web kami serta untuk berapa lama), dan, (iii) data navigasi atau alur klik lain yang sejenis (misalnya pelaporan lalu-lintas situs dan keunikan penghitungan pengunjung).<br />\n<br />\n<em>Suar-suar Web</em><br />\n<br />\nKami dapat menggunakan suar web (atau GIF yang jelas) di Situs Wyeth Nutrition.&nbsp;Suar Web (juga dikenal sebagai &quot;web bug&quot;) adalah sebaris kecil kode yang menyediakan metode penyampaian gambar grafis pada halaman web untuk tujuan mentransfer data kembali kepada kami.&nbsp;Kami menggunakan informasi suar web untuk berbagai tujuan, termasuk informasi mengenai bagaimana pengguna merespon kampanye e-mail (misalnya saat e-mail dibuka, di mana pengguna menghubungi melalui e-mail), pelaporan lalu lintas situs, keunikan jumlah pengunjung, iklan dan audit e-mail dan pelaporan, dan personalisasi).<br />\n<br />\n<strong>5.&nbsp;Mengelola cookie/preferensi Anda</strong><br />\n<br />\nAnda harus memastikan bahwa pengaturan komputer Anda mencerminkan apakah Anda senang menerima&nbsp;cookie&nbsp;atau tidak.&nbsp;Anda dapat mengatur&nbsp;browser&nbsp;Anda untuk memperingatkan Anda sebelum menerima&nbsp;cookies, atau Anda dapat mengaturnya untuk menolak mereka.&nbsp;Anda tidak perlu memiliki&nbsp;cookie&nbsp;untuk menggunakan atau menavigasi melalui banyak bagian dari Situs Wyeth Nutrition meskipun Anda mungkin tidak memiliki akses ke semua fitur pada Situs Wyeth Nutrition jika Anda melakukannya.&nbsp;Anda dapat melihat tombol &#39;bantuan&#39; pada&nbsp;browser&nbsp;Anda (misalnya pada&nbsp;Internet Explorer, Firefox) untuk membantu bagaimana Anda bisa melakukan hal ini.&nbsp;Ingat bahwa jika Anda menggunakan komputer yang berbeda di lokasi yang berbeda, Anda akan perlu memastikan bahwa masing-masing&nbsp;browser&nbsp;disesuaikan dengan preferensi&nbsp;cookies&nbsp;Anda.<br />\n<br />\nKarena suar web merupakan bagian dari sebuah halaman web, itu tidak mungkin untuk &#39;memilih tidak melakukan&#39; tetapi Anda dapat membuat mereka tidak efektif dengan memilih keluar dari&nbsp;cookie&nbsp;yang sudah mereka atur.<br />\n<br />\nSelain itu, jika tersedia, Anda bisa menjalankan pilihan Anda dalam memungkinkan untuk&nbsp;cookie&nbsp;ditempatkan pada komputer Anda atau tidak menempatkan&nbsp;cookie&nbsp;tersebut dengan mengunjungi situs berikut dan memilih&nbsp;cookie&nbsp;perusahaan Anda ingin memilih untuk keluar daripadanya:&nbsp;<a href=\"http://www.aboutads.info/choices/\" target=\"_blank\">http://www.aboutads.info/choices/#completed</a>&nbsp;atau&nbsp;<a href=\"&quot;http://www.youronlinechoices.eu/&quot;\" target=\"&quot;_blank&quot;\">http://www.youronlinechoices.eu/</a><a href=\"http://www.youronlinechoices.eu/\">.</a>&nbsp;<br />\n<br />\n<strong>6.&nbsp;Pembaharuan Pernyataan Legal</strong><br />\n&nbsp;<br />\nKami berhak untuk melakukan perubahan dan koreksi terhadap pernyataan ini.&nbsp;Silakan lihat halaman ini pada setiap saat guna meninjau hal ini dan informasi tambahan terbaru.<br />\n&nbsp;<br />\nPernyataan ini terakhir diperbarui September 2015.<br />\n&copy;2015&nbsp;Nestl&eacute; &nbsp;Hak cipta dilindungi.<br />\n&nbsp;','dummy',NULL,'dummy','dummy'),
  (34,'2018-01-16 03:47:44','2018-01-16 04:47:42',122,24,'<a href=\"https://www.nestle.co.id/ina/tentangnestle/corporatebusinessprinciple/laporkan-keluhan-anda\">Prinsip-Prinsip Bisnis Perusahaan Nestl&eacute;</a> mencerminkan komitmen kami dalam menganut budaya kepatuhan yang tinggi sebagai dasar yang tidak dapat ditawar dalam menjalankan bisnis.<br />\n???<br />\nLebih dari sekadar kata-kata di atas kertas, prinsip-prinsip bisnis kami dapat ditindaklanjuti dengan nyata dan kami siap untuk melakukan apa pun yang diperlukan untuk memastikan bahwa perusahaan dikelola dengan cara-cara yang sejalan dengan komitmen kami. Anda bisa membantu kami mencapai tujuan ini. Sistem Pelaporan Kepatuhan kami, &ldquo;Tell Us&rdquo;, menyediakan sebuah jalur komunikasi khusus bagi Anda dan para pemangku kepentingan perusahaan untuk <strong>melaporkan tindakan-tindakan yang berpotensi melanggar Prinsip-Prinsip Bisnis Perusahaan kami.</strong><br />\n<strong>PENTING</strong>: Keluhan terkait produk atau pelayanan kami dapat dilaporkan melalui <a href=\"https://www.wyethnutrition.co.id/keluhan-kode-etik-who\" target=\"notSet\">laman Kontak Kami</a> atau Careline kami di nomor telepon 0800 1821 526.<br />\n<br />\nBagaimana cara mengirimkan laporan?<br />\n<br />\n&#39;Tell Us&#39;, Sistem Pelaporan Kepatuhan kami, dapat diakses setiap saat (24 jam sehari, 365 hari setahun).\n<ol>\n\t<li>Untuk mengirimkan laporan, Anda mempunyai dua pilihan cara, yaitu melalui sebuah situs khusus dengan mengisi formulir online atau melalui nomor telepon bebas pulsa. Apa pun cara yang Anda pilih, laporan Anda akan kami tangani dengan prosedur yang sama.\n\t<ol>\n\t\t<li><strong>Melalui</strong> <a href=\"https://www.nestle.co.id/ina/tentangnestle/corporatebusinessprinciple/laporkan-keluhan-anda\">situs khusus (situs dalam bahasa Inggris)</a><br />\n\t\tAnda akan diminta untuk memasukkan kode akses: 11021<br />\n\t\tAnda dapat melampirkan dokumen-dokumen untuk melengkapi laporan Anda. Laporan<br />\n\t\tAnda akan langsung diteruskan ke Nestl&eacute;.</li>\n\t\t<li><strong>Melalui telepon</strong>: <a href=\"https://www.nestle.co.id/ina/tentangnestle/corporatebusinessprinciple/laporkan-keluhan-anda\">Daftar nomor bebas pulsa dan kode akses &#39;Tell Us&#39; di seluruh dunia</a><br />\n\t\tHubungi nomor telepon dan masukkan kode akses sesuai dengan negara asal Anda berdasarkan daftar di atas. Panggilan Anda tidak akan dijawab oleh operator, namun sebuah sistem kotak suara akan merekam pesan Anda dan mengirimkan salinannya ke Nestl&eacute;.</li>\n\t</ol>\n\t</li>\n\t<li>Setelah Anda melaporkan keluhan, baik melalui pengisian formulir online maupun melalui telepon, Anda akan menerima sebuah nomor laporan. Catatlah nomor ini dan simpan dengan aman.</li>\n\t<li>Nomor laporan ini merupakan akses personal Anda untuk membuka kembali laporan yang telah Anda kirimkan melalui Sistem Pelaporan Kepatuhan kami. Anda dapat menelusuri status laporan Anda atau menambahkan informasi pelengkap baru. Anda harus memasukkan nomor laporan tersebut setiap kali Anda ingin mengakses kembali sistem ini.</li>\n\t<li>Kami menangani semua laporan yang kami terima dengan serius dan akan melakukan tindak lanjut yang tepat untuk setiap laporan. Kami akan selalu memberikan informasi mengenai langkah-langkah yang telah diambil dan status penanganan laporan Anda.</li>\n\t<li>Anda dapat mengakses kembali <a href=\"https://www.nestle.co.id/ina/tentangnestle/corporatebusinessprinciple/laporkan-keluhan-anda\">situs ini </a>setiap saat (masukkan kembali kode akes 11021) untuk menelusuri status penanganan laporan Anda menggunakan nomor laporan Anda.</li>\n\t<li>Kami berkomitmen untuk selalu meningkatkan kualitas Sistem Pelaporan Kepatuhan kami dan berhak untuk membuat perubahan-perubahan yang dianggap perlu pada sistem kami.</li>\n</ol>\n','dummy',NULL,'dummy','dummy');
COMMIT;

