  (1,'comments','Comment Notification','Email that is sent to admin when someone creates a comment','You have just received a comment from {{ name }}','<h3>You have received a comment from {{ name }}</h3>\n\t\t\t\t<p>\n\t\t\t\t<strong>IP Address: {{ sender_ip }}</strong><br/>\n\t\t\t\t<strong>Operating System: {{ sender_os }}<br/>\n\t\t\t\t<strong>User Agent: {{ sender_agent }}</strong>\n\t\t\t\t</p>\n\t\t\t\t<p>{{ comment }}</p>\n\t\t\t\t<p>View Comment: {{ redirect_url }}</p>','en',1,'comments'),
  (2,'contact','Contact Notification','Template for the contact form','{{ settings:site_name }} :: {{ subject }}','This message was sent via the contact form on with the following details:\n\t\t\t\t<hr />\n\t\t\t\tIP Address: {{ sender_ip }}\n\t\t\t\tOS {{ sender_os }}\n\t\t\t\tAgent {{ sender_agent }}\n\t\t\t\t<hr />\n\t\t\t\t{{ message }}\n\n\t\t\t\t{{ name }},\n\t\t\t\t\n\t\t\t\t{{ email }}','en',1,'pages'),
  (3,'registered','New User Registered','Email sent to the site contact e-mail when a new user registers','{{ settings:site_name }} :: You have just received a registration from {{ name }}','<h3>You have received a registration from {{ name }}</h3>\n\t\t\t\t<p><strong>IP Address: {{ sender_ip }}</strong><br/>\n\t\t\t\t<strong>Operating System: {{ sender_os }}</strong><br/>\n\t\t\t\t<strong>User Agent: {{ sender_agent }}</strong>\n\t\t\t\t</p>','en',1,'users'),
  (4,'activation','Activation Email','The email which contains the activation code that is sent to a new user','{{ settings:site_name }} - Account Activation','<p>Hello {{ user:first_name }},</p>\n\t\t\t\t<p>Thank you for registering at {{ settings:site_name }}. Before we can activate your account, please complete the registration process by clicking on the following link:</p>\n\t\t\t\t<p><a href=\"{{ url:site }}users/activate/{{ user:id }}/{{ activation_code }}\">{{ url:site }}users/activate/{{ user:id }}/{{ activation_code }}</a></p>\n\t\t\t\t<p>&nbsp;</p>\n\t\t\t\t<p>In case your email program does not recognize the above link as, please direct your browser to the following URL and enter the activation code:</p>\n\t\t\t\t<p><a href=\"{{ url:site }}users/activate\">{{ url:site }}users/activate</a></p>\n\t\t\t\t<p><strong>Activation Code:</strong> {{ activation_code }}</p>','en',1,'users'),
  (7,'parent-email','parent-email','Email Template for Parent User','You have just received a contact from {{ name }} | {{ email }}','Hai Bapak/Ibu {{ parent_email }},<br />\n<br />\nSaat ini, anak dari Bapak/Ibu yang bernama {{ name }} sedang mendaftarkan dirinya untuk mengikuti keseruan #HappyBreak di website COCA-COLA Indonesia.<br />\n<br />\nDi www.break.coca-cola.co.id, COCA-COLA mengajak remaja Indonesia untuk merayakan waktu istirahat siang mereka dengan berbagai aktivitas seru.<br />\nCaranya, dengan memberikan tantangan seru supaya mereka bisa beraktivitas bersama teman-temannya dan juga berbagi inspirasi dengan menuliskan pengalaman mereka saat mengisi waktu istirahatnya.<br />\n<br />\nCOCA-COLA menyadari bahwa remaja di bawah 17 tahun, masih mendapatkan pengawasan penuh dari orangtuanya. Jika Bapak/Ibu tidak menyetujui pendaftaran mereka di website tersebut, silakan klik <a href=\"{{ link }}\">disini</a> sehingga COCA-COLA dapat menolak pendaftaran anak Bapak/Ibu.<br />\n<br />\nTerimakasih.','en',0,''),
  (8,'forgotten_password','Forgotten Password Email','The email that is sent containing a password reset code','{{ settings:site_name }} - Forgotten Password','<p style=\"font-size: 13px; line-height: 20.8px;\">Halo {{ user:first_name }},</p>\n\n<p style=\"font-size: 13px; line-height: 20.8px;\"><span style=\"line-height: 20.8px;\">Anda baru saja meminta untuk mengatur ulang kata sandi pada akun ProGOLD Parenting Club Anda</span>.<br />\nSilahkan mengunjungi link berikut untuk mengganti kata sandi baru Anda:&nbsp;<a href=\"{{ url:site }}users/reset_pass/{{ user:forgotten_password_code }}\">{{ url:site }}users/reset_pass/{{ user:forgotten_password_code }}</a></p>\n\n<p style=\"font-size: 13px; line-height: 20.8px;\">Jika Anda tidak meminta untuk mengatur ulang kata sandi, mohon abaikan pesan ini.&nbsp;<br />\n<br />\nAda pertanyaan?<br />\nHubungi Wyeth Careline 0800 1821 526</p>','en',1,'users'),
  (9,'new_password','New Password Email','After a password is reset this email is sent containing the new password','{{ settings:site_name }} - New Password','<p>Hello {{ user:first_name }},</p>\n\t\t\t\t<p>Your new password is: {{ new_password }}</p>\n\t\t\t\t<p>After logging in you may change your password by visiting <a href=\"{{ url:site }}edit-profile\">{{ url:site }}edit-profile</a></p>','en',1,'users'),
  (10,'reset-password','reset password','Request reset password','lupa password coke-break','Hey {{kepada}},<br />\n<br />\nLupa password profil coke-break?<br />\nKlik <a href=\"{{link}}\">di sini</a> untuk mereset password anda.<br />\n<br />\nSalam,<br />\ncoke-break','en',0,''),
  (11,'contact-wyeth','Contact Wyeth','Contact Wyeth','Anda Mendapatkan Pesan dari {{name}} | {{email}}','<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Nama : {{name}}</span><br style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\" />\n<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Email :&nbsp;</span><span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">{{email}}</span><br style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\" />\n<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Phone Number:&nbsp;{{phone}}</span><br style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\" />\n<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Message:&nbsp;{{message}}</span>','en',0,''),
  (12,'contact-wyeth','Contact Wyeth','Contact Wyeth','Anda Mendapatkan Pesan dari {{name}} | {{email}}','<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Nama : {{name}}</span><br style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\" />\n<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Email :&nbsp;</span><span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">{{email}}</span><br style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\" />\n<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Phone Number:&nbsp;{{phone}}</span><br style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\" />\n<span style=\"font-size: 13px; line-height: 20.8px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Message:&nbsp;{{message}}</span>','id',0,''),
  (13,'sukses-register','Sukses Register','Email Notifikasi','Sukses Register','Selamat Datang {{kepada}},<br />\n<br />\nTerima kasih&nbsp; telah bergabung bersama ProGOLD Parenting Club, Mam bisa memperoleh beragam informasi menarik seputar tumbuh kembang Si Kecil dan konsultasi Ask The Expert yang mendukung Aksi Pintarnya. Selain itu, Mam juga bisa memperoleh beragam keuntungan dalam progam Gold Reward, klik tautan berikut untuk info selengkapnya&nbsp;https://www.progoldparentingclub.co.id/dashboard<br />\n<br />\nAda pertanyaan?<br />\nHubungi Wyeth Careline 0800 1821 526<br />\nEmail: [wyethcareline.indonesia@wyethnutrition.com]','en',0,''),
  (14,'sukses-edit','Sukses Edit','Profile Update','Profile Update','Halo Mam,<br />\n<br />\nProfile Mam telah berhasil di Update. Silahkan cek <a href=\"http://progoldparentingclub.co.id/stage/dashboard\">disini</a> ya Mam.<br />\n<br />\nAda pertanyaan?<br />\nHubungi Wyeth Careline 0800 1821 526<br />\nEmail: [wyethcareline.indonesia@wyethnutrition.com]','en',0,''),
  (15,'sukses-ubah-password','Sukses Ubah Password','Email notifikasi','Sukses Ubah Password','Halo Mam,<br />\n<br />\nPassword Mam telah berhasil diubah.&nbsp;<span style=\"font-size: 13px; line-height: 20.8px;\">Silahkan cek&nbsp;</span><a href=\"http://progoldparentingclub.co.id/stage/dashboard\" style=\"font-size: 13px; line-height: 20.8px;\">disini</a><span style=\"font-size: 13px; line-height: 20.8px;\">&nbsp;ya Mam</span><br />\n<br />\nAda pertanyaan?<br />\nHubungi Wyeth Careline 0800 1821 526<br />\nEmail: [wyethcareline.indonesia@wyethnutrition.com]','en',0,''),
  (16,'update-poin-gold-reward','Update Poin GOLD Reward','Update Poin GOLD Reward','Update Poin GOLD Reward','Halo Mam [user_name],<br />\n<br />\nDengan e-mail ini kami memberitahukan bahwa ada perubahan point Gold Reward. Klik tombol di bawah ini untuk melihat aktivitas point gold reward Mam:<br />\nhttps://www.progoldparentingclub.co.id/dashboard<br />\n<br />\nTerus kumpulkan poinnya ya Mam dengan cara mengirimkan struk pembelian S-26 Procal Gold, S-26 Promise Gold, S-26 Nutrisure Gold, S-26 Procal &amp; S-26 Promise. Lihat juga berbagai informasi hadiah menarik untuk &nbsp;Mam<br />\n<br />\nInformasi selengkapnya, kunjungi halaman <u>Gold Reward</u><br />\n<br />\nAda pertanyaan?<br />\nHubungi Wyeth Careline 0800 1821 526<br />\n&nbsp;','en',0,''),
  (17,'daily-reply','Daily Reply','Daily Reply','Daily Reply','Halo {user_name},<br />\n<br />\nTerima kasih atas partisipasi Mam dalam ProGOLD Parenting Club. Informasi dan pertanyaan yang Mam berikan telah mendapatkan respon dari Mam lainnya. Klik tombol di bawah ini untuk melihat aktivitas selengkapnya:<br />\n<br />\nhttp://progoldparentingclub.co.id/dashboard<br />\n<br />\nAda pertanyaan?<br />\nHubungi Wyeth Careline 0800 1821 526','en',0,'');
COMMIT;

