  (402,20,'5. Saya ingin mengenali jenis kepintaran anak saya, tetapi mengapa saya tidak bisa menggunakan fitur Smart Strength Finder?','Fitur Smart Strength Finder otomatis dapat digunakan apabila usia anak yang tercantum di profil Anda di atas 1 tahun.',NULL,1479252853,1479252853,5),
  (403,20,'6. Saya ingin mencari informasi mengenai sekolah yang tepat untuk mendukung kepintaran anak saya, tetapi mengapa saya tidak bisa menggunakan fitur Smart School?','Fitur Smart School otomatis dapat digunakan apabila usia anak yang tercantum di profil Anda di atas 1 tahun.',NULL,1479252853,1479252853,6),
