  (517,20,'4. Bagaimana cara mengaktifkan akun saya di Parenting Club?','Cara mengaktifkannya adalah dengan mengecek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol ???Konfirmasi Sekarang???, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.\n\nApabila akun Anda telah diaktifkan, maka Anda dapat login ke Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club.\n\nJika email notifikasi tidak juga masuk ke inbox email ataupun folder spam Anda, kembalilah ke homepage Parenting Club, lalu klik kolom login yang terletak di bagian kanan atas. Setelah muncul window untuk login, klik bagian ???forgot password???, lalu ikuti langkah selanjutnya.',NULL,1479252853,1479252853,4),
  (518,20,'5. Saya ingin mengenali jenis kepintaran anak saya, tetapi mengapa saya tidak bisa menggunakan fitur Smart Strength Finder?','Fitur Smart Strength Finder otomatis dapat digunakan apabila usia anak yang tercantum di profil Anda di atas 1 tahun.',NULL,1479252853,1479252853,5),
