  (626,20,'1. Saya ingin bergabung dengan Parenting Club, tetapi mengapa saya tidak bisa register?','Saat melakukan registrasi, pastikan Anda mengisi kolom data yang diminta dengan benar sesuai petunjuk. Pada kolom nomor telepon, cukup cantumkan angka, tanpa spasi atau simbol apa pun.\n\nContoh penulisan nomor telepon yang benar: 08111234567\nContoh penulisan nomor telepon yang salah: +62 811 1234 567 atau 081-1123-4567\n\nPastikan juga bahwa email dan nomor telepon yang Anda cantumkan belum pernah digunakan untuk mendaftar di situs Parenting Club sebelumnya. Setelah semua kolom telah terisi, beri tanda centang pada kolom ???I???m not a robot??? dan kolom yang menyatakan Anda menyetujui Syarat dan Ketentuan Wyeth Nutrition, lalu klik bagian register.',NULL,1479252878,1479252878,1),
  (627,20,'2. Saya sudah pernah register di Parenting Club, tetapi mengapa saya tidak bisa login?','Setelah registrasi, Anda perlu melakukan aktivasi akun Anda terlebih dahulu. Caranya, cek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol ???Konfirmasi Sekarang???, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.\n\nApabila akun Anda telah diaktifkan, maka Anda dapat login di Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club.Penulisan password yang benar adalah minimal terdiri dari 8 karakter, dan merupakan gabungan dari huruf, angka, dan simbol.\n\nContoh penulisan password yang benar: mamanayra_1306 atau mamanayra@1306\nContoh penulisan password yang salah: mamanay',NULL,1479252878,1479252878,2),
  (628,20,'3. Bagaimana cara mengganti password saya di Parenting Club?','Untuk mengganti password, Anda cukup login, kemudian buka profile page Anda. Klik kolom setting, lalu klik bagian ???change password???. Isi ketiga kolom yang tersedia, lalu klik ???update setting???.',NULL,1479252878,1479252878,3),
  (629,20,'4. Bagaimana cara mengaktifkan akun saya di Parenting Club?','Cara mengaktifkannya adalah dengan mengecek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol ???Konfirmasi Sekarang???, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.\n\nApabila akun Anda telah diaktifkan, maka Anda dapat login ke Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club.\n\nJika email notifikasi tidak juga masuk ke inbox email ataupun folder spam Anda, kembalilah ke homepage Parenting Club, lalu klik kolom login yang terletak di bagian kanan atas. Setelah muncul window untuk login, klik bagian ???forgot password???, lalu ikuti langkah selanjutnya.',NULL,1479252878,1479252878,4),
