  (860,20,'7.Saya telah mengirimkan pertanyaan mengenai perkembangan anak saya kepada tim ahli dari Parenting Club melalui fitur Smart Consultation. Berapa lama saya harus menunggu untuk mendapatkan jawabannya? ','Fitur Smart Consultation merupakan tempat bagi Anda untuk berkonsultasi dengan para ahli mengenai proses pertumbuhan, perkembangan dan cara mendukung kepintaran si Kecil. Seluruh peserta yang terlibat dan berpartisipasi aktif dalam Fitur ini dianggap telah membaca dan memahami dengan baik, serta setuju tanpa syarat untuk patuh dan taat pada syarat dan ketentuan Fitur.\n\nUntuk dapat berpartisipasi dalam fitur Smart Consultation, peserta wajib mendaftar sebagai anggota Parenting Club. Pertanyaan yang dikirimkan oleh seluruh peserta akan melalui proses moderasi oleh penyelenggara. Pertanyaan yang tidak relevan/pertanyaan yang bersifat medis tidak akan dijawab untuk menghindari kesalahan diagnosis. Pertanyaan yang dikirim selambat-lambatnya pada hari Senin pukul 12 siang akan dijawab oleh tim ahli pada hari Jumat setiap minggunya. Peserta yang pertanyaannya dijawab oleh tim ahli akan menerima email notifikasi. ',NULL,1479252879,1479252879,7),
  (861,20,'8. Akun saya di Parenting Club tiba-tiba terkunci. Bagaimana cara mengaktifkannya kembali?','Buka homepage Parenting Club, lalu klik kolom login yang terletak di bagian kanan atas. Setelah muncul window untuk login, klik bagian ???forgot password???. Pada laman selanjutnya, isi kolom email sesuai dengan email yang dicantumkan pada saat registrasi di Parenting Club, lalu klik ???forgot password???. \n\nBuka inbox email Anda, dan klik email dari Parenting Club. Klik ???ubah password???, isi dengan password baru, lalu klik ???Reset Password???.\n\nPerlu diketahui bahwa proses re-aktivasi akun yang terkunci melalui mekanisme forgot pasword hanya dapat dilakukan jika Anda sudah melakukan registrasi dan aktivasi melalui email kemudian salah menuliskan password hingga lima kali sehingga akun Anda otomatis terkunci. \n\nProses re-aktivasi akun yang terkunci tidak bisa dilakukan jika Anda sudah melakukan registrasi tetapi belum pernah melakukan aktivasi melalui email. Bila ini yang terjadi, maka Anda harus melakukan aktivasi akun terlebih dahulu. Lihat caranya pada FAQ No. 4',NULL,1479252879,1479252879,8),
  (862,20,'1. Saya ingin bergabung dengan Parenting Club, tetapi mengapa saya tidak bisa register?','Saat melakukan registrasi, pastikan Anda mengisi kolom data yang diminta dengan benar sesuai petunjuk. Pada kolom nomor telepon, cukup cantumkan angka, tanpa spasi atau simbol apa pun.\n\nContoh penulisan nomor telepon yang benar: 08111234567\nContoh penulisan nomor telepon yang salah: +62 811 1234 567 atau 081-1123-4567\n\nPastikan juga bahwa email dan nomor telepon yang Anda cantumkan belum pernah digunakan untuk mendaftar di situs Parenting Club sebelumnya. Setelah semua kolom telah terisi, beri tanda centang pada kolom ???I???m not a robot??? dan kolom yang menyatakan Anda menyetujui Syarat dan Ketentuan Wyeth Nutrition, lalu klik bagian register.',NULL,1479252879,1479252879,1),
  (863,20,'2. Saya sudah pernah register di Parenting Club, tetapi mengapa saya tidak bisa login?','Setelah registrasi, Anda perlu melakukan aktivasi akun Anda terlebih dahulu. Caranya, cek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol ???Konfirmasi Sekarang???, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.\n\nApabila akun Anda telah diaktifkan, maka Anda dapat login di Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club.Penulisan password yang benar adalah minimal terdiri dari 8 karakter, dan merupakan gabungan dari huruf, angka, dan simbol.\n\nContoh penulisan password yang benar: mamanayra_1306 atau mamanayra@1306\nContoh penulisan password yang salah: mamanay',NULL,1479252879,1479252879,2),
  (864,20,'3. Bagaimana cara mengganti password saya di Parenting Club?','Untuk mengganti password, Anda cukup login, kemudian buka profile page Anda. Klik kolom setting, lalu klik bagian ???change password???. Isi ketiga kolom yang tersedia, lalu klik ???update setting???.',NULL,1479252879,1479252879,3),
  (865,20,'2. Saya sudah pernah register di Parenting Club, tetapi mengapa saya tidak bisa login?','Setelah registrasi, Anda perlu melakukan aktivasi akun Anda terlebih dahulu. Caranya, cek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol ???Konfirmasi Sekarang???, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.\n\nApabila akun Anda telah diaktifkan, maka Anda dapat login di Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club.Penulisan password yang benar adalah minimal terdiri dari 8 karakter, dan merupakan gabungan dari huruf, angka, dan simbol.\n\nContoh penulisan password yang benar: mamanayra_1306 atau mamanayra@1306\nContoh penulisan password yang salah: mamanay',NULL,1479252879,1479252879,2),
  (866,20,'3. Bagaimana cara mengganti password saya di Parenting Club?','Untuk mengganti password, Anda cukup login, kemudian buka profile page Anda. Klik kolom setting, lalu klik bagian ???change password???. Isi ketiga kolom yang tersedia, lalu klik ???update setting???.',NULL,1479252879,1479252879,3),
  (867,20,'4. Bagaimana cara mengaktifkan akun saya di Parenting Club?','Cara mengaktifkannya adalah dengan mengecek inbox email yang Anda gunakan saat registrasi di Parenting Club. Buka email dari Parenting Club, lalu klik tombol ???Konfirmasi Sekarang???, dan akun Anda pun sudah aktif. Bila email dari Parenting Club tidak terlihat di inbox, Anda bisa mengeceknya di dalam folder spam.\n\nApabila akun Anda telah diaktifkan, maka Anda dapat login ke Parenting Club. Pastikan username dan password yang Anda masukkan sesuai dengan yang dicantumkan pada saat register di Parenting Club.\n\nJika email notifikasi tidak juga masuk ke inbox email ataupun folder spam Anda, kembalilah ke homepage Parenting Club, lalu klik kolom login yang terletak di bagian kanan atas. Setelah muncul window untuk login, klik bagian ???forgot password???, lalu ikuti langkah selanjutnya.',NULL,1479252879,1479252879,4),
