  (1042,20,'5. Saya ingin mengenali jenis kepintaran anak saya, tetapi mengapa saya tidak bisa menggunakan fitur Smart Strength Finder?','Fitur Smart Strength Finder otomatis dapat digunakan apabila usia anak yang tercantum di profil Anda di atas 1 tahun.',NULL,1479252880,1479252880,5),
