  (1,'2016-05-25 11:04:33',NULL,121,55,122,'Wyeth Nutrition','Wyeth ','Nutrition',NULL,'en','Wyeth Nutrition mengembangkan produk nutrisi berkualitas premium secara ilmiah untuk melengkapi nutrisi anak-anak. Sebagai pelopor nutrisi, Wyeth Nutrition memiliki misi untuk memberikan asupan dan dukungan nutrisi terbaik untuk kesehatan yang lebih baik. Selama lebih dari 100 tahun, Wyeth Nutrition terus meningkatkan penelitian ilmiah dan uji klinis serta standar keamanan manufaktur kelas dunia untuk memberikan solusi ilmiah dan membantu pertumbuhan anak-anak.',NULL,'0000-00-00','',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1479346550,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'uploads/profile/57e9944dcb0f7.png',NULL,'0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,'0',NULL,'on',NULL,NULL,NULL,NULL,NULL,NULL,0,0);
