  (115,'home_title','Home Title','Home Title','text','','Inspirasi untuk jadikan pintarnya si Kecil bersinar','',1,'wyeth'),
  (116,'home_description','Home Description','Home Description','textarea','','Dalam mendukung tumbuh kembang anak, Anda pasti membutuhkan berbagai informasi penting seputar dunianya. Tak perlu khawatir, kini informasi yang Anda butuhkan sudah terkumpul dalam satu wadah. Yuk jelajahi artikel yang akan membantu Anda mendukung kepintaran si Kecil agar semakin bersinar.','',1,'wyeth'),
  (117,'smart_consultation_title','Smart Consultation Title','Smart Consultation Title','text','','Punya pertanyaan seputar dunia si Kecil?','',1,'wyeth'),
  (118,'smart_consultation_description','Smart Consultation Description','Smart Consultation Description','textarea','','Tak perlu khawatir, kini Anda bisa bertanya mengenai perkembangan anak pada tim ahli kami. \nAyo konsultasikan permasalahan Anda pada tim kami yang terdiri dari psikolog, dokter anak, dan ahli nutrisi.','',1,'wyeth'),
